import React from 'react';
import OutputScreenRow from './outputScreenRow.js';
import '../index.css'

const OutputScreen = (props) => {
  return (
    <div className='row'>
      <div className='col-1'>
      Input
      <input className="screen-row" type="text" readOnly value = {props.question}/>
      Output
      <input className="screen-row" type="text" readOnly value = {props.answer}/>
    </div>
    </div>
  )
}

export default OutputScreen;
